class Solution {

    boolean check(String s,Set<Long> hashSet) {
      int n = s.length();
      int[] f = new int[n + 1];
      Arrays.fill(f, -1);
      f[0] = 0;
      for (int i = 0; i <= n; i++) {
        if (f[i] == -1) continue;
        long cur = 0;
        for (int j = i + 1; j <= n; j++) {
          cur=(cur*27+s.charAt(j-1))%Long.MAX_VALUE;
          if (hashSet.contains(cur)) f[j] = Math.max(f[j], f[i] + 1);
        }
        if (f[n] > 1) return true;
      }
      return false;
    }
    public List<String> findAllConcatenatedWordsInADict(String[] words) {
      List<String> answer=new ArrayList<>();
      if(words.length==1) return answer;
      Set<Long> hashSet=new HashSet<>();
      for(String word:words){
        if(word.equals("")) continue;
        long code=0;
        for(int i=0;i<word.length();i++)
          code=(code*27+word.charAt(i))%Long.MAX_VALUE;
        hashSet.add(code);
      }

      for(String word:words){
        if(word.equals("")) continue;
        if(check(word,hashSet))
          answer.add(word);
      }
      return answer;
    }
}
