class Solution1 {
    public int hash(String str,int start,int end){
      int code=0;
      for(int i=start;i<end;i++)
        code=(code*26+str.charAt(i))%2147483647;
      return code;
    }
    public boolean dfs(int index,String word,Set<Integer> hashSet){
       if(index==word.length()) return true;
       for(int i=1;i+index<=word.length();i++){
         if(hashSet.contains(hash(word,index,index+i))){
           if(dfs(index+i,word,hashSet))
             return true;
         }
       }
      return false;
    }
    public List<String> findAllConcatenatedWordsInADict(String[] words) {
      List<String> answer=new ArrayList<>();
      if(words.length==1) return answer;
      Set<Integer> hashSet=new HashSet<>();
      Arrays.sort(words, new Comparator<String>() {
        @Override
        public int compare(String o1, String o2) {
          return o1.length()-o2.length();
        }
      });
      for(String word:words){
        if(word.equals("")) continue;
        if(dfs(0,word,hashSet))
          answer.add(word);
        hashSet.add(hash(word,0,word.length()));
      }
      return answer;
    }
}

